window.bookSummaryJSON = "<p>“<b>I am not his conquest. I am not his to claim. I am my own castle.”</b></p> <p>Freed from the golden clutches of the Sun King, Lor now finds herself in the hands of Nadir, the Aurora Prince. Convinced she’s hiding something, he’s willing to do whatever it takes to make her talk. But Lor knows the value of secrets—she’s been keeping them her entire life—and she’s not letting hers go without a fight.</p> <p>When Lor and Nadir team up to search for a lost item that holds the key to her past and her future, she isn’t sure if she can trust him. All she knows is she won’t fall for his promises and make the same mistakes again.</p> <p>Lor also hasn’t forgotten her vow to destroy the Aurora King. As Atlas hunts her across Ouranos, Lor plots to bring down the Imperial Fae who took everything. But she soon realizes that the future of the continent is about so much more than just her shattered legacy.</p> <p><i>Rule of the Aurora King </i>is the second book in the Artefacts of Ouranos series and combines romance, intrigue, action, and adventure. If you love enemies to lovers, fated mates, and fake dating, don’t miss this exciting next installment!</p>"; 
